            return React.createElement(Review, {
                key: index,
                attributes: item.attributes
            });
        });
    }

    return React.createElement(
        Wrapper,
        null,
        loaded && React.createElement(
            Fragment,
            null,
            React.createElement(
                Column,
                null,
                React.createElement(
                    Main,
                    null,
                    React.createElement(Header, {
                        attributes: restaurant.data.attributes,
                        reviews: restaurant.included
                    }),
                    display_reviews
                )
            ),
            React.createElement(
                Column,
                null,
                React.createElement(ReviewForm, {
                    handleChange: handleChange,
                    handleSubmit: handleSubmit,
                    setRating: setRating,
                    attributes: restaurant.data.attributes,
                    review: review
                })
            )
